INSERT INTO public.cereal_cereal (id, "cerealName", "cerealContents", description, "amountInStock", price, image, manufacturer_id, "nutritionValue_id", type_id) VALUES (1, 'Cocoa Puffs', 'Whole Grain Corn, Sugar, Corn Syrup, Corn Meal, Canola and/or Rice Bran Oil, Cocoa Processed with Alkali, Color Added, Salt, Tricalcium Phosphate, Fructose, Corn Starch, Natural and Artificial Flavor, Trisodium Phosphate, BHT Added to Preserve Freshness.', 'Cocoa Puffs is an American brand of chocolate-flavored puffed grain breakfast cereal.', 50, 5.99, 'https://images.heb.com/is/image/HEBGrocery/001397066', 1, 1, 2);
INSERT INTO public.cereal_cereal (id, "cerealName", "cerealContents", description, "amountInStock", price, image, manufacturer_id, "nutritionValue_id", type_id) VALUES (7, 'Corn Flakes', 'Corn Grits (87.7%), Sugar, Cereal Extract, Iodized Salt, Vitamins, Minerals And Antioxidant (INS 320).', 'Corn flakes, or cornflakes, are a breakfast cereal made from toasting flakes of corn (maize). The cereal, originally made with wheat, was created by William Kellogg in 1894 for his brother John Kellogg. John Kellogg wanted a food that would be healthy for the patients of the Battle Creek Sanitarium in Michigan where he was superintendent. The breakfast cereal proved popular among the patients, but Will Kellogg wanted to add sugar to increase the popularity. John Kellogg did not approve of this, so Will Kellogg started his own company Kellogg Company to produce corn flakes for the wider public. A patent for the process was granted in 1896, after a legal battle between the two brothers.', 250, 2, 'data:image/jpeg;base64,', 2, 1, 1);
INSERT INTO public.cereal_cereal (id, "cerealName", "cerealContents", description, "amountInStock", price, image, manufacturer_id, "nutritionValue_id", type_id) VALUES (2, 'Annie''s Fruity Bunnies and Blossoms', 'WHOLE GRAIN CORN MEAL*, WHOLE GRAIN OATS*, CANE SUGAR*, RICE FLOUR*, TAPIOCA SYRUP*, COLOR (ELDERBERRY JUICE CONCENTRATE*, CARROT CONCENTRATE*, ANNATTO*, PUMPKIN CONCENTRATE*, APPLE CONCENTRATE*), SUNFLOWER OIL*, NATURAL FLAVOR*, SEA SALT, BAKING SODA. MI', 'Annie''s Bunnies and Blossoms are certified USDA Organic and made with real fruit. We wholeheartedly recommend these cute Bunnies for breakfast cereal, or as a midday snack for kids and adults alike.', 210, 7, 'https://i5.walmartimages.com/asr/4bc9f55d-7949-483a-b5ce-f0293ada4083.6dc63574b21a85b872d046cebbc54c2c.jpeg', 5, 1, 1);
INSERT INTO public.cereal_cereal (id, "cerealName", "cerealContents", description, "amountInStock", price, image, manufacturer_id, "nutritionValue_id", type_id) VALUES (3, 'Peanut Butter Puffins', 'Corn Flour, Cane Sugar, Peanut Butter (peanuts, salt), Whole Grain Oat Flour, Rice Flour, Sea Salt, Baking Soda, Sunflower Oil, Tocopherols (antioxidants to maintain freshness)', 'Made with real peanut butter and without any artificial colors or flavors, Barbara''s Peanut Butter Puffins are free of the most common food allergens for school-safe snacking.', 250, 3, 'https://images-na.ssl-images-amazon.com/images/I/91rbRSRY3DL._AC_SY606_.jpg', 6, 1, 2);
INSERT INTO public.cereal_cereal (id, "cerealName", "cerealContents", description, "amountInStock", price, image, manufacturer_id, "nutritionValue_id", type_id) VALUES (4, 'Cap''n Crunch Crunch Berries', 'CORN FLOUR, SUGAR, OAT FLOUR, BROWN SUGAR, PALM AND/OR COCONUT OIL, SALT, SODIUM CITRATE, NATURAL AND ARTIFICIAL FLAVOR, MALIC ACID, RED 40, REDUCED IRON, YELLOW 5, NIACINAMIDE*, BLUE 1, YELLOW 6, BHT (TO PRESERVE FRESHNESS), THIAMINE MONONITRATE*, PYRIDO', 'Original Cap''n Crunch is downright delicious and can hold its own in the cereal aisle, but in our opinion, Cap''n Crunch''s Crunch Berries is even better. The sweetened corn and oat berry shapes add fruity flavor to the mix, making each bite a little more interesting than its original parent flavor.', 250, 2.99, 'https://images-na.ssl-images-amazon.com/images/I/81pQ91RAWyL._SY879_PIbundle-5,TopRight,0,0_SX557SY879SH20_.jpg', 3, 1, 2);
INSERT INTO public.cereal_cereal (id, "cerealName", "cerealContents", description, "amountInStock", price, image, manufacturer_id, "nutritionValue_id", type_id) VALUES (12, 'Apple Jacks', 'CORN FLOUR BLEND (WHOLE GRAIN YELLOW CORN FLOUR, DEGERMINATED YELLOW CORN FLOUR), SUGAR, WHEAT FLOUR, WHOLE GRAIN OAT FLOUR, CONTAINS 2% OR LESS OF VEGETABLE OIL (HYDROGENATED COCONUT, SOYBEAN AND/OR COTTONSEED, CANOLA), OAT FIBER, SALT, SOLUBLE CORN FIBE', 'A perfect balance between texture and flavor, the crystallized flavor dots wrapped around each neon orange and green ring adds a surprising amount of apple-cinnamon sweetness and crunch to each bite of Apple Jacks.', 400, 2.33, 'data:image/jpeg;base64,', 2, 1, 2);
INSERT INTO public.cereal_cereal (id, "cerealName", "cerealContents", description, "amountInStock", price, image, manufacturer_id, "nutritionValue_id", type_id) VALUES (11, 'Honey Nut Cheerios', 'Whole grain oats, sugar, oat bran, corn starch, honey, brown sugar syrup, salt, tripotassium phosphate, rice bran oil and/or canola oil, natural almond flavor, vitamin E (mixed tocopherols) added to preserve freshness.Added to Preserve Freshness.', 'Honey Nut Cheerios is a variation of Cheerios breakfast cereal, introduced in 1979 by Yandel Gonzalez, who was in the General Mills cereal company.[1] Unlike the original Cheerios, the third variation is sweeter than the original, with a honey and almond flavor. The second variation is Cinnamon Nut Cheerios which was test marketed in 1976. While Honey Nut Cheerios used to be made with actual nuts, as of 2006, the nuts were discontinued, and natural flavor, from peach and apricot pit, is used instead.', 400, 3.2, 'data:image/jpeg;base64,', 1, 1, 2);
INSERT INTO public.cereal_cereal (id, "cerealName", "cerealContents", description, "amountInStock", price, image, manufacturer_id, "nutritionValue_id", type_id) VALUES (10, 'Cinnamon Toast Crunch', 'Whole Grain Wheat, Sugar, Rice Flour, Canola and/or Rice Bran Oil, Fructose, Maltodextrin, Dextrose, Salt, Cinnamon, Soy Lecithin, Trisodium Phosphate, Color Added. BHT Added to Preserve Freshness', 'Another crowd-pleaser, Cinnamon Toast Crunch wins the all-important award for most delicious leftover cereal milk at the bottom of the bowl. These crunchy little squares also taste delicious crumbled into pastry crusts or used as a topping in other baked goods.', 250, 2.99, 'data:image/jpeg;base64,', 1, 1, 2);
INSERT INTO public.cereal_cereal (id, "cerealName", "cerealContents", description, "amountInStock", price, image, manufacturer_id, "nutritionValue_id", type_id) VALUES (9, 'Frosted Flakes', 'Milled corn, sugar, malt flavor, contains 2% or less of salt. Vitamins and Minerals: Iron (ferric phosphate), niacinamide, vitamin B6 (pyridoxine hydrochloride), vitamin B2 (riboflavin), vitamin B1 (thiamin hydrochloride), folic acid, vitamin D3, vitamin', 'Frosted Flakes or Frosties is a breakfast cereal, produced by the Kellogg Company and consisting of sugar-coated corn flakes. It was introduced in the United States, in 1952,[1] as Sugar Frosted Flakes. The word "sugar" was dropped from the name in 1983.', 250, 2.99, 'data:image/jpeg;base64,', 2, 1, 2);
INSERT INTO public.cereal_cereal (id, "cerealName", "cerealContents", description, "amountInStock", price, image, manufacturer_id, "nutritionValue_id", type_id) VALUES (8, 'Frosted Cheerios', 'Whole Grain Oats, Sugar, Oat Bran, Corn Starch, Corn Syrup, Salt, Trisodium Phosphate, Brown Sugar Syrup, Natural Flavor. Vitamin E (mixed tocopherols) Added to Preserve Freshness.', 'Taste just like frosted flakes! So if you''re looking for that flavor, with the benefits of a cheerio, this is the cereal for you!', 100, 4.99, 'data:image/jpeg;base64,', 1, 1, 2);
INSERT INTO public.cereal_cereal (id, "cerealName", "cerealContents", description, "amountInStock", price, image, manufacturer_id, "nutritionValue_id", type_id) VALUES (6, 'Cookie Crisp', 'Whole Grain Corn, Sugar, Corn Meal, Yellow Corn Flour, Canola Oil, Corn Syrup, Cocoa Processed With Alkali, Brown Sugar Syrup, Salt, Caramel Color, Baking Soda, Natural Flavor.', 'Another sugary sweet dessert-for-breakfast-style treat, Cookie Crisp is the obvious choice for all you cookie monsters out there. The modern recipe is fortified with more vitamins and minerals than the original ingredient list, making this at least a semi-nutritious option for little ones.', 50, 1.2, 'data:image/jpeg;base64,', 1, 1, 2);
INSERT INTO public.cereal_cereal (id, "cerealName", "cerealContents", description, "amountInStock", price, image, manufacturer_id, "nutritionValue_id", type_id) VALUES (20, 'Fruity Pebbles', 'Rice, Sugar, Hydrogenated Vegetable Oil (Coconut and Palm Kernel Oils), Salt, contains less than 0.5% of Natural and Artificial Flavor, Red 40, Yellow 6, Turmeric Oleoresin (Color), Blue 1, Yellow 5, Blue 2, BHA (to help protect flavor).', 'Need a little color in your breakfast cereal? We suggest Fruity Pebbles. This sweet rainbow treat is great alone, but even better as a topping to vanilla ice cream.', 130, 2.5, 'https://pics.drugstore.com/prodimg/413360/900.jpg', 4, 1, 2);
INSERT INTO public.cereal_cereal (id, "cerealName", "cerealContents", description, "amountInStock", price, image, manufacturer_id, "nutritionValue_id", type_id) VALUES (5, 'Cheerios', 'Whole Grain Oats, Corn Starch, Sugar, Salt, Tripotassium Phosphate. Vitamin E (mixed tocopherols) Added to Preserve Freshness.', 'Cheerios is a brand of cereal manufactured by General Mills in the United States, consisting of pulverized oats in the shape of a solid torus. In some countries, including the United Kingdom, Cheerios is marketed by Cereal Partners under the Nestl brand; in Australia and New Zealand, Cheerios is sold as an Uncle Tobys product. It was first manufactured in 1941 as CheeriOats.', 200, 2.88, 'https://www.cheerios.com/wp-content/uploads/2018/04/YBC_460x460.png', 1, 1, 1);
INSERT INTO public.cereal_cereal (id, "cerealName", "cerealContents", description, "amountInStock", price, image, manufacturer_id, "nutritionValue_id", type_id) VALUES (23, 'Weetabix', 'Wholegrain Wheat (95%), Malted Barley Extract, Sugar, Salt, Niacin, Iron, Riboflavin (B2), Thiamin (B1), Folic Acid. * Riboflavin, Niacin, Folic Acid & Iron', 'Weetabix is a whole-grain wheat breakfast cereal produced by Weetabix Limited in the United Kingdom. It comes in the form of palm-sized (approx. 9.5 cm  5.0 cm or 4"  2") rounded rectangle-shaped biscuits. Variants include organic and Weetabix Crispy Minis (bite-sized) versions.[1][2] The UK cereal is manufactured in Burton Latimer, Northamptonshire, and exported to over 80 countries.[3] Weetabix for Canada and the United States is manufactured in Cobourg, Ontario, in both organic and conventional versions.', 250, 1.99, 'https://www.hollandretail.nl/images/products/710/103004a.jpg', 7, 1, 1);
INSERT INTO public.cereal_cereal (id, "cerealName", "cerealContents", description, "amountInStock", price, image, manufacturer_id, "nutritionValue_id", type_id) VALUES (21, 'Honey Bunches of Oats with Crispy Almonds', 'Corn, Whole Grain Wheat, Sugar, Whole Grain Rolled Oats, Almonds, Rice, Canola Oil, Wheat Flour, Malted Barley Flour, Corn Syrup, Salt, Molasses, Honey, Caramel Color, Barley Malt Extract, Cinnamon, Natural and Artificial Flavor, Annatto Extract (Color).', 'This cereal has a little bit of everything. Almonds, granola clusters, and crispy flakes fill every delicious spoonful. Honey Bunches of Oats packs 10 grams of whole grains per serving, as well as nine essential vitamins and minerals.', 50, 5, 'data:image/webp;base64,', 4, 1, 2);
INSERT INTO public.cereal_cereal (id, "cerealName", "cerealContents", description, "amountInStock", price, image, manufacturer_id, "nutritionValue_id", type_id) VALUES (22, 'Life Cinnamon Breakfast Cereal', 'Whole grain oat flour, sugar, corn flour, whole wheat flour, rice flour, calcium carbonate, salt, cinnamon, disodium phosphate, caramel color, reduced iron, niacinamide, dextrin, zinc oxide, yellow 6, BHT (a preservative), yellow 5, thiamin mononitrate, r', 'Another classic option, Quaker''s Life Cereal is a family favorite with its simple ingredient list that includes 18 grams of whole grains per serving.', 30, 2.9, 'https://target.scene7.com/is/image/Target/GUEST_e89c2068-69bf-420a-add3-7bf913cf59c9?wid=325&hei=325&qlt=80&fmt=webp', 3, 1, 1);
INSERT INTO public.cereal_cereal (id, "cerealName", "cerealContents", description, "amountInStock", price, image, manufacturer_id, "nutritionValue_id", type_id) VALUES (18, 'Kix', 'WHOLE GRAIN CORN, CORN MEAL, SUGAR, SALT, BROWN SUGAR SYRUP, BAKING SODA, VITAMIN E (MIXED TOCOPHEROLS) ADDED TO PRESERVE FRESHNESS.', 'Something about Kix takes us back to watching cartoons on a Saturday morning. This delicious cereal is sweet, simple, and wholesome  and it''s a good source of calcium and vitamin D.   Feelin'' a little nostalgic? This cereal is a must.', 10, 4, 'https://images-na.ssl-images-amazon.com/images/I/81MSjNIvM9L._SL1500_.jpg', 1, 1, 1);
INSERT INTO public.cereal_cereal (id, "cerealName", "cerealContents", description, "amountInStock", price, image, manufacturer_id, "nutritionValue_id", type_id) VALUES (17, 'Kellogg''s Special K', 'Rice (36.2%), Whole Wheat (33.2%), Sugar, Wheat Bran (4.7%), Liquid Glucose, Iodized Salt, Cereal Extract, Vitamins, Mineral and Antioxidant (INS 320).', 'Special K is a brand of breakfast cereal and meal bars manufactured by Kellogg''s. The cereal was introduced to the United States in 1955.[1] It is made primarily from grains like lightly toasted rice, wheat and barley. Special K used to be marketed primarily as a low-fat cereal that can be eaten to help one lose weight.', 150, 3.99, 'https://assets.sainsburys-groceries.co.uk/gol/7973058/1/640x640.jpg', 2, 1, 1);
INSERT INTO public.cereal_cereal (id, "cerealName", "cerealContents", description, "amountInStock", price, image, manufacturer_id, "nutritionValue_id", type_id) VALUES (16, 'Raisin Bran', 'Whole grain wheat, raisins, wheat bran, sugar, brown sugar syrup, malt flavor, salt, and added vitamins and minerals.', 'Classic Raisin Bran is a cereal created with a nod to the basic pleasure of textural contrasts. Chewy sweetened raisins mingle with the crunchy crisp of whole grain wheat and bran flakes for a satisfying and layered bite.', 1000, 0.9, 'https://target.scene7.com/is/image/Target/GUEST_dd44ca43-cc5f-4b4a-9244-e8101d1cca73?fmt=webp&wid=1400&qlt=80', 2, 1, 1);
INSERT INTO public.cereal_cereal (id, "cerealName", "cerealContents", description, "amountInStock", price, image, manufacturer_id, "nutritionValue_id", type_id) VALUES (15, 'Frosted Mini-Wheats', 'Whole Grain Wheat, Sugar, Contains 2% or Less of Brown Rice Syrup, Gelatin, BHT for Freshness. Vitamins and Minerals: Reduced Iron, Niacinamide, Vitamin B6 (Pyridoxine Hydrochloride), Vitamin B2 (Riboflavin), Vitamin B1 (Thiamin Hydrochloride), Zinc Oxide', 'Made with eight crunchy layers of whole grains with a thin layer of frosting, Mini Wheats are actually loaded with 9 grams of fiber per serving to keep you fuller longer.  Plus, there''s that magical texture moment when the frosting begins to melt off into the milk and time stands still.', 300, 2.5, 'https://target.scene7.com/is/image/Target/GUEST_caa2baba-752e-4c6f-b3db-699633f4b543?wid=700&hei=700&qlt=80&fmt=webp', 2, 1, 2);
INSERT INTO public.cereal_cereal (id, "cerealName", "cerealContents", description, "amountInStock", price, image, manufacturer_id, "nutritionValue_id", type_id) VALUES (14, 'Froot Loops', 'CORN FLOUR BLEND (WHOLE GRAIN YELLOW CORN FLOUR, DEGERMINATED YELLOW CORN FLOUR), SUGAR, WHEAT FLOUR, WHOLE GRAIN OAT FLOUR, CONTAINS 2% OR LESS OF OAT FIBER, HYDROGENATED VEGETABLE OIL (COCONUT, SOYBEAN AND/OR COTTONSEED), SALT, SOLUBLE CORN FIBER, NATUR', 'Something about that first bite of Froot Loops is so crunchy, sweet, and satisfying that  if you''re anything like us, at least  you''ll tear through a whole bowl in record time just to have a second helping.', 250, 3.99, 'data:image/jpeg;base64,', 2, 1, 2);
INSERT INTO public.cereal_cereal (id, "cerealName", "cerealContents", description, "amountInStock", price, image, manufacturer_id, "nutritionValue_id", type_id) VALUES (13, 'Cookies & Crme Krispies', 'Rice, sugar, contains 2% or less of salt, rice flour, malt flavor, cocoa processed with alkali, natural flavor. Vitamins and Minerals: Iron (ferric phosphate), niacinamide, vitamin B6 (pyridoxine hydrochloride), vitamin B2 (riboflavin), vitamin B1 (thiami', 'If you''re looking for a twist on an all-time favorite, this is IT. Kellogg''s really outdid themselves with this sugary, sweet gem. Cookies & Creme Krispies  feature chocolate flavored cookie bits and tasty creme flavor. YUM.', 500, 1.5, 'data:image/jpeg;base64,', 2, 1, 2);
INSERT INTO public.cereal_cereal (id, "cerealName", "cerealContents", description, "amountInStock", price, image, manufacturer_id, "nutritionValue_id", type_id) VALUES (24, 'Weetos', 'Wholegrain Wheat (49%), Wheat Flour, Sugar, Maltodextrin, Fat Reduced Cocoa Powder, Salt, Potassium Chloride, Flavouring, Calcium Carbonate, Niacin, Iron, Riboflavin (B2), Vitamin B6, Thiamin (B1), Folic Acid, Vitamin D, Vitamin B12.', 'Weetos is a brand of chocolate-flavoured breakfast cereal produced by Weetabix Food Company. The name comes from the fact that its primary ingredient is wheat (Weet-) and the cereal pieces are in O shapes (-Os), the same naming convention that is used on the company''s flagship cereal Weetabix (Wheat Biscuits).', 250, 2.99, 'https://i.pinimg.com/564x/e8/20/85/e820859feabd07a4c10563d9203344d7.jpg', 7, 1, 2);
INSERT INTO public.cereal_cereal (id, "cerealName", "cerealContents", description, "amountInStock", price, image, manufacturer_id, "nutritionValue_id", type_id) VALUES (19, 'Lucky Charms', 'Whole Grain Oats, Sugar, Corn Starch, Modified Corn Starch, Corn Syrup, Dextrose. Contains 2% or less of: Salt, Gelatin, Trisodium Phosphate, Red 40, Yellow 5 & 6, Blue 1, Natural and Artificial Flavor. Vitamin E (mixed tocopherols) Added to Preserve Fres', 'Lucky Charms is an American brand of breakfast cereal produced by the General Mills food company since 1964.[1] The cereal consists of toasted oat pieces and multi-colored marshmallow shapes (or marshmallow bits). The label features a leprechaun mascot, Lucky, animated in commercials.', 400, 5.99, 'https://images-na.ssl-images-amazon.com/images/I/81z7JObRqgL._SL1500_.jpg', 1, 1, 2);